import React from 'react';

function OrderDetails({ data }) {
  return (
    <div>
      <h4>주문 내역</h4>
      {data.map(order => (
        <div key={order.orderId}>
          <p>주문 ID: {order.orderId}</p>
          <p>사용자 ID: {order.userId}</p>
          <p>주문 날짜: {order.orderDate}</p>
          <p>상태: {order.status}</p>
          <p>총 금액: {order.totalAmount}</p>
        </div>
      ))}
    </div>
  );
}

export default OrderDetails;
